window.bookSummaryJSON = "<p>My Villain. My Rebel. My Ruthless Hunter</p> <p>Hunter Le Blanche is one of New York's most sought-after billionaires.</p> <p>People call him the Wall Street Shark because he always gets what he wants.</p> <p>His latest conquest just happens to be me.</p> <p>We met by mistake.</p> <p>I thought he was someone else when I was attempting to cross off the most significant item on my bucket list—losing my V card.</p> <p>Fleeing with embarrassment, I hoped never to see the beautiful devil again.</p> <p>However, fate had other plans for me the next day when my father announces I'm to marry him.</p> <p>My father needs Hunter's investment and our union to increase his chances of becoming governor. While Hunter needs a wife to get the Le Blanche empire.</p> <p>Bound by duty, I agree to the marriage—as if I had a choice.</p> <p>That's the moment my world becomes a twisted fairytale.</p> <p>Belle had the Beast.</p> <p>Persephone had Hades.</p> <p>I have the Shark.</p> <p>Falling for Hunter Le Blanche is a mistake I can't afford.</p> <p>Our tale isn't exactly like the one as old as time.</p> <p>But suddenly I'm enjoying his touch and him calling me his wife more than I should.</p> <p>Everything about him weakens my resolve, and soon I can't help myself.</p> <p>Neither can he.</p> <p>Until the day I find out his true intentions and dark secrets.</p> <p>Hunter isn't the man I believed him to be.</p> <p>Neither is our marriage.</p> <p>This is an arranged marriage, enemies to lovers, dark billionaire romance. It is a complete standalone with mature language, themes, and content intended for mature listeners only.</p>"; 
